import React, { useState } from "react";
import Profile from "../components/profile";
import Nav from '../../homePage/components/nav';

const  UserSettings =() =>{
    const [pick , setPick] = useState("Profile");
    return (
        <div>
            <Nav />
            <div class='grid grid-flow-col h-[80vh] mt-8'>
                <div class="ml-5 pl-2 w-full bg-white flex justify-center items-start ">
                    <ul class="my-4 list-none  pt-5 w-full bg-gray-50">
                        <li onClick={() => setPick("Profile")}>Profile</li>
                        <li onClick={() => setPick("changePassword")}>Change Password</li>
                        <li>Liked Recipes</li>
                    </ul>
                </div>
                <div class="w-full">
                    {pick =="Profile" ? (<Profile/>) : pick =="changePassword" ? (<changePassword/>) :<likedRecipies/> }
                </div>
            </div>
        </div>
    )
}
export default UserSettings
